import React, { Component } from 'react';


export default class list extends Component {
    render() {
        return (

            <div className="container">
                <h2>B Tabla que muestra los nombres</h2>
                <table className="table">
                    <thead>
                    <tr>
                        <th>Firstname</th>
                        <th>Lastname</th>
                        <th>Email</th>
                    </tr>
                    </thead>
                    <tbody>



                    </tbody>
                </table>
            </div>
        );
    }
}
